        // 11 - correct
        [false, false, false, false, true, false, false, false, false, false, true, false, true, false, false],
        // 12
        [false, false, false, false, true, true, true, true, true, true, true, false, false, true, false],
        // 13
        [true, true, true, true, true, true, true, true, true, true, true, true, true, true, true],
        // 14
        [false, false, false, false, false, false, false, false, false, false, false, false, true, false, false],
        // 15
        [false, false, false, false, false, false, false, false, false, false, false, true, false, false, false],
    ]

    const gameRows = RowObject(rawRows);

    const colNums = Columns(gameRows);
    const rowNums = Rows(gameRows);

    const level2 = gameRows.map(row=>{
        return (
            <Row 
                row={row}
                key={'row-'+nanoid()}
            />
        );
    })

    const board = <Board gameRows={gameRows} rowNums={rowNums} colNums={colNums} />

    return (
        <div>
            {level2}
        </div>
    )
}
